import axios from 'axios';
export const handleSigninApi = (userPhone, userPassword, checked) => {
    if(checked === 1)
        return axios.post('/api/login/customer', {phone: userPhone, password: userPassword});
    else if (checked === 2)
        return axios.post('api/login/staff', {phone: userPhone, password: userPassword});
    else if (checked === 3)
        return axios.post('/api/login/admin', {phone: userPhone, password: userPassword});
}
